MINN KOTA/ミンコタ　<br />クイックリリース　MKA-52/62 <br />モーターのマウントをボートのデッキに簡単に着脱できるブラケット。<br /><span style="color: #ff00ff;">対応マウント</span><br /><span style="color: #ff6600;"><span style="color: #ff6600;">マクサム／マクサムプロマウント（52/62インチ）</span></span><hr /><span style="color: #0000ff;">上下2枚のプレートの上側をマウントの裏側に、下側をボートのデッキに固定します。<br />取り付ける際には2枚のプレートを噛み合わせてスライドさせて取り付けます。</span><hr /><img src="http://image.rakuten.co.jp/backlash/cabinet/00186092/img55898234.jpg" alt="" border="0" />【smtb-TK】<style>
